import { AuthProvider } from 'react-auth-kit';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './components/Home';

const App = () => {
    return (
        <BrowserRouter>
            <Routes>
                <AuthProvider>
                    <Route path="/" element={<Home />} />
                    {/* Define other routes as needed */}
                </AuthProvider>
            </Routes>
        </BrowserRouter>
    );
};

export default App;
